  root: {
    backgroundColor: theme.palette.primary.light,
  },
}));

const Footer = () => {
  return (
    <Box>
      <Container maxWidth="lg">
        <div className="Footer">
          <ul>
            <li>
              <Typography variant="subtitle1">
                This is a project build by Raynulfo Mata
              </Typography>
            </li>
            <li>
              <Typography variant="subtitle1">Build on May 2021</Typography>
            </li>
          </ul>
          <Typography variant="subtitle1">All Rights reserved. LOL</Typography>
        </div>
      </Container>
    </Box>
  );
};

export default Footer;
